import { Table } from "antd";
const LeadersTable = () => {
  const columns = [
    {
      title: "ציון ממוצע סופי",
      dataIndex: "overallAvgGrade",
      sorter: (a, b) => a.overallAvgGrade - b.overallAvgGrade,
    },
    {
      title: "ציון ממוצע למטלה",
      dataIndex: "avgGradePerAssignment",
      sorter: (a, b) => a.avgGradePerAssignment - b.avgGradePerAssignment,
    },
    {
      title: "עיר",
      dataIndex: "city",
      sorter: (a, b) => a.age - b.age,
    },
    {
      title: "תלמידים",
      dataIndex: "howManyStudents",
      sorter: (a, b) => a.howManyStudents - b.howManyStudents,
    },

    {
      title: "כיתה",
      dataIndex: "grade",
      sorter: (a, b) => a.age - b.age,
    },

    {
      title: "בית ספר",
      dataIndex: "school",
      sorter: (a, b) => a.age - b.age,
    },
    {
      title: "מקום",
      dataIndex: "place",
      sorter: (a, b) => a.place - b.place,
    },
  ];

  const data = [
    {
      key: 1,
      place: 1,
      school: "John Brown",
      grade: "ו-2",
      city: "בת ים",
      howManyStudents: 23,
      avgGradePerAssignment: 95,
      overallAvgGrade: 90,
    },
    {
      key: 2,
      place: 2,
      school: "John Brown",
      grade: "ו-4",
      city: "חיפה",
      howManyStudents: 43,
      avgGradePerAssignment: 65,
      overallAvgGrade: 50,
    },
  ];

  return (
    <div>
      <Table
        bordered
        style={{
          width: "80%",
          margin: "auto",
          borderRadius: "25px",
          boxShadow: "0 0 8px black",
        }}
        columns={columns}
        dataSource={data}
        pagination={false}
      />
    </div>
  );
};

export default LeadersTable;
